    Contact: 'contact',
    Resume: 'resume',
    Portfolio: 'portfolio',
    Skills: 'skills',
    Stats: 'Stats',
    Testimonials: 'Testimonials'
}


export const heroData = {
    imageSrc: heroImage,
    name: "I'm Samuel Tsui",
    description: (
        <p>
